define({"topics" : [{"title":"Schema and Table Name Patterns","shortdesc":"\n                  <p class=\"shortdesc\">You define the group of tables that the Teradata Consumer origin reads by defining         schema and table name patterns\n                     for the table configuration. The origin reads all tables         whose names match the table pattern in the schemas whose\n                     names match the schema pattern. \n                  </p>\n               ","href":"datacollector\/UserGuide\/Origins\/Teradata.html#concept_ank_41x_4y","attributes": {"data-id":"concept_ank_41x_4y",},"menu": {"hasChildren":false,},"tocID":"concept_ank_41x_4y-d46e72431","topics":[]},{"title":"Offset Column and Value","shortdesc":"\n                  <p class=\"shortdesc\">The Teradata Consumer origin uses an offset column and initial offset value to determine         where to start reading data\n                     within tables and partitions.\n                  </p>\n               ","href":"datacollector\/UserGuide\/Origins\/Teradata.html#concept_yfx_mhx_4y","attributes": {"data-id":"concept_yfx_mhx_4y",},"menu": {"hasChildren":false,},"tocID":"concept_yfx_mhx_4y-d46e72507","topics":[]}]});